import Login from './../pagina_login/login';
import { MyProvider } from '../user_info/user_info';

function RotaInicial(){
    const {login} = useUserinfo()


return(
    <MyProvider>
    {login ? (
        <PaginaPrincipal />
      ):(
        <Login/>
      )}
</MyProvider>
)

}export default RotaInicial
